import { React, useEffect } from "react";
import CardList from "../../Components/CardList/CardList.component.jsx";
import Addproduct from "../../Components/AddProduct/AddProduct.component.jsx";

const HomePage = () => {
  const [restuarantList, setRestuarantList] = useState();
  const [cuisines, setCuisines] = useState();
  const [masterRestuarantList, setmasterRestuarantList] = useState();
  useEffect(() => {
    Papa.parse(
      "https://s3-ap-southeast-1.amazonaws.com/he-public-data/restaurantsa9126b3.csv",
      {
        download: true,
        header: true,
        complete: function (results) {
          getCuisinesList(results.data);
          results.data.pop();
          setRestuarantList(results.data);
          setmasterRestuarantList(results.data);
        },
      }
    );
  }, []);
  return (
    <>
      <div>
        <Addproduct />
      </div>
      <div
        style={{
          display: "grid",
          flexDirection: "column",
          justifyContent: "center",
          alignItems: "center",
        }}
      >
        <CardList />
      </div>
    </>
  );
};

export default HomePage;
